window.bookSummaryJSON = "<p>Charlie Naylor is a good guy, but he's never been great at multi-tasking. When Larynk, the god of corn, sends Charlie into a fantasy game, he just can't help himself trying. By combining his love of daggers, magic, and animals, he becomes the Blademage Beastmaster. </p> <p>With a dangerous new pet, a deadly selection of daggers, and some awesome spells, he must make allies and kill monsters as he walks his path to glory. If he can do that, then he might just create a legacy for himself. </p> <p>He used to work in an office where he pushed paper, filled in spreadsheets, and made coffee. Now, he casts, conjures, stabs, and tames.</p>"; 
